import (
	context "context"
	fern "github.com/auth-environment-variables/fern"
	fernclient "github.com/auth-environment-variables/fern/client"
	option "github.com/auth-environment-variables/fern/option"
)

client := fernclient.NewClient(
	option.WithApiKey(
		"<YOUR_ApiKey>",
	),
)
response, err := client.Service.GetWithHeader(
	context.TODO(),
	&fern.HeaderAuthRequest{
		XEndpointHeader: "X-Endpoint-Header",
	},
)
